import React from 'react';
import Head from 'next/head';
import { Menu, Icon } from 'antd';

const Home = () => {
    return (
        <>
        <Head>
            <title>대출해드림</title>
            <link rel="stylesheet" href="bootstrap/dist/css/bootstrap.min.css" />
        </Head>
        </>
    )
}

export default Home;
